1/ Chap 29CHAPITRE 29
PRODUITS CHIMIQUES ORGANIQUES
Notes.
1. - Sauf dispositions contraires, les positions du présent Chapitre comprennent seulement :
a) des composés organiques de constitution chimique définie présentés isolément, que ces composés
contiennent ou non des impuretés;
b) des mélanges d’isomères d’un même composé organique (que ces mélanges contiennent ou non des
impuretés), à l’exclusion des mélanges d’isomères (autres que les stéréoisomères) des
hydrocarbures acycliques, saturés ou non (Chapitre 27);
c) les produits des n°s 29.36 à 29.39, les éthers, acétals et esters de sucres et leurs sels du 
n° 29.40 et les produits du n° 29.41, de constitution chimique définie ou non;
d) les solutions aqueuses des produits des paragraphes a), b) ou c) ci-dessus;
e) les autres solutions des produits des paragraphes a), b) ou c) ci-dessus, pour autant que ces solutions
constituent un mode de conditionnement usuel et indispensable, exclusivement motivé par des
raisons de sécurité ou par les nécessités du transport, et que le solvant ne rende pas le produit apte à
des emplois particuliers plutôt qu’à son emploi général;
f) les produits des paragraphes a), b), c), d) ou e) ci-dessus, additionnés d’un stabilisant 
(y compris d’un agent antiagglomérant) indispensable à leur conservation ou à leur transport;
g) les produits des paragraphes a), b), c), d), e)ou f) ci-dessus, additionnés d’une substance anti-
poussiéreuse, d’un colorant ou d’un odoriférant ou d’un émétique,afin d'en faciliter l’identification ou
pour des raisons de sécurité, pour autant que ces additions ne rendent pas le produit apte à des
emplois particuliers plutôt qu’à son emploi général;
h) les produits ci-après, mis au type, pour la production de colorants azoïques : sels de diazonium,
copulants utilisés pour ces sels et amines diazotables et leurs sels.
2. - Le présent Chapitre ne comprend pas :
a) les produits du n° 15.04, ainsi que le glycérol brut du (n° 15.20);
b) l’alcool éthylique (n°s 22.07 ou 22.08);
c) le méthane et le propane (n° 27.11);
d) les composés du carbone mentionnés à la Note 2 du Chapitre 28;
e) les produits immunologiques du n° 30.02;
f) l’urée (n°s 31.02 ou 31.05) ;
g) les matières colorantes d’origine végétale ou animale (n° 32.03), les matières colorantes organiques
synthétiques, les produits organiques synthétiques des types utilisés comme agents d’avivage
fluorescents ou comme luminophores (n° 32.04) ainsi que les teintures et autres matières colorantes
présentées dans des formes ou emballages pour la vente au détail (n° 32.12);
h) les enzymes (n° 35.07);
ij) sous des formes similaires impliquant leur utilisation comme combustibles, ainsi que les combustibles
liquides et gaz combustibles liquéfiés en récipients des types utilisés pour alimenter ou recharger les
briquets ou les allumeurs et d’une capacité n’excédant pas 300 cm3 (n°36.06) ;
k) les produits extincteurs présentés comme charges pour appareils extincteurs ou dans des grenades
ou bombes extinctrices du n° 38.13; les produits encrivores conditionnés dans des emballages de
vente au détail, compris dans le n° 38.24;
